query:
SELECT ?osmid ?distance ?loc ?tag WHERE {
  VALUES ?tag { "brothel" "casino" "conference_centre" "events_venue" "gambling" "love_hotel" "nightclub" "stripclub" "swingerclub" "prison" }
  ?osmid osmt:amenity ?tag . 
  SERVICE wikibase:around { 
      ?osmid osmm:loc ?loc . 
      bd:serviceParam wikibase:center "Point(12.707037 50.597179)"^^geo:wktLiteral . 
      bd:serviceParam wikibase:radius "15" . 
      bd:serviceParam wikibase:distance ?distance .
  } 
  FILTER(?distance < 15)
}
